stylesheets.content:
#animated-boi {
  animation: 3s badanim;
  border: 1px solid black;
}

@keyframes badanim {
  from {
    margin-left: 100%;
    height: 50px;
  }

  to {
    margin-left: 0%;
    height: 200px;
  }
}

